import React, {Component} from 'react';

class MyComponent extends Component{

    render(){
        return (
            <React.Fragment>
            <h1>Hola , soy el componente llamado: MyComponent</h1>
            <h2>Estoy probando el componente</h2>
            <hr/>
            </React.Fragment>
        );
    }

}

export default MyComponent;
